    function updateVoterTokenByEmail(
        string memory _email,
        string memory _newToken
    ) public {
        for (uint256 i = 1; i <= voterCount; i++) {
            // Update the token if the email matches
            if (keccak256(bytes(_email)) == keccak256(bytes(voters[i].email))) {
